import React, { Component } from 'react';
import { WebView } from 'react-native-webview';
import {Button, View} from 'react-native'

export default class App extends Component {
  reload(){
    this.myWebView.reload()
  }
  render() {
    return (
      <View style={{flex:1}}>
     <WebView
      injectedJavaScript={'function hideHeaderToggle() {var headerToggle = document.getElementsByClassName("cco-header"), i;for (i = 0; i < headerToggle.length; i += 1) {headerToggle[i].style.display = "none";};}; hideHeaderToggle();'}
      injectedJavaScript={INJECTEDJAVASCRIPT}
      scrollEnabled
      ref={(webView) => {
        this.webView = webView
      }}
      style={{marginTop: 0}}
      originWhitelist={['*']}
      source={{ uri: 'https://equippersdunedin.churchcenter.com/registrations' }}
      onNavigationStateChange={(navState) => {
        this.setState({
          backButtonEnabled: navState.canGoBack,
        })
      }}
    />
     <Button onPress={()=>this.reload()} title="reload" />
   </View>
    );
  }
}
